import React from 'react';
import TodoListItem from './todo-list-item';

const TodoList = () => {
    const items = ['Learn React', 'Build an App']
    return (
        <ul>
            <li>
                {items[0]}</li>
            <li>
                {items[1]}</li>
            <li><TodoListItem/></li>
        </ul>
    );
};

export default TodoList;
